    last = ('-1', 0)
    a_grouped.append(last)
    for ai in a:
        if last[0] == ai:
            last = (ai, last[1] - 1)
            a_grouped[-1] = last
        else:
            last = (ai, 1)
            a_grouped.append(last)
        if last[1] == k:
            a_grouped.pop()
            last = a_grouped[-1]
    a_grouped.pop(0)
    s1 = 0
    while len(a_grouped) > 0 and a_grouped[0][0] == a_grouped[-1][0]:
        if len(a_grouped) == 1:
            s = a_grouped[0][1] * m
            r1 = s % k
            if r1 == 0:
                return s1 % k
            else:
                return r1 + s1
        join = a_grouped[0][1] + a_grouped[-1][1]
        if join < k:
            break
        elif join % k == 0:
            s1 += join
            a_grouped.pop()
            a_grouped.pop(0)
        else:
            s1 += join // k * k
            a_grouped[0] = (a_grouped[0][0], join % k)
            a_grouped.pop()
            break
    s = 0
    for ai in a_grouped:
        s += ai[1]
    return s * m + s1

